import React, { Component } from "react";
import CardList from "./CardList"
import { robots } from './robots'
import SearchBox from "./SearchBox"

const state = {
    robots: robots,
    searchfield: ""
}

class App extends Component {
    constructor() {
        super()
        this.state = {
            robots: robots,
            searchfield: ""
        }
    }

    onSearchChange(event) {
        console.log(event);
    }


    render() {
        return (
            <div className="tc">
                <h1>Kitty Friends</h1>
                <SearchBox />
                <CardList robots={this.state.robots}/>
            </div>
        );
        }
    
}








export default App;
